  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0110254 includes discrete
  sample and profile data collected from JAMES CLARK ROSS in the Indian Ocean, South
  Atlantic Ocean and Southern Oceans (> 60 degrees South) from 2008-12-26 to 2009-01-30.
  These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113),
  CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC
  CARBON (DIC), DISSOLVED OXYGEN, Delta Oxygen-18, HYDROSTATIC PRESSURE, NITRATE,
  SALINITY, SULFUR HEXAFLUORIDE (SF6), TOTAL ALKALINITY (TA), Tritium (Hydrogen isotope),
  WATER TEMPERATURE, phosphate and silicate. The instruments used to collect these
  data include CTD, Coulometer for DIC measurement and bottle.nnThese data were collected
  by Dorothee C. E. Bakker of University of East Anglia; School of Environmental Sciences
  as part of the CLIVAR_A12_JC30_2008 data set. CDIAC associated the following cruise
  ID(s) with this data set: CLIVAR_A12_JC30_2008nnThe International CLIVAR Global
  Ocean Carbon and Repeat Hydrography Program carries out a systematic and global
  re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes in
  storage and transport of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
